import { Link } from "react-router-dom";
import "../header.css";
import {React} from "react";

function Nav(){
    <Link to="/header"></Link>
    window.alert("Working");
}


function Header(){
    return(
        <div>
            <nav className="nvgbar">
                <ul style={{listStyleType:"none"}}>
                    <li>Home</li>
                    <li>Our Services</li>
                    <li>About Us</li>
                    <li>Extras</li>
                    <button onClick={Nav()} type="button" id="strbtn" className="strbtn">Get Started!</button>
                </ul>
                

                
            </nav>
        </div>
    );
}
export default Header
